CREATE TABLE tracks_features (
    id VARCHAR(22) PRIMARY KEY,
    name TEXT,
    album TEXT,
    album_id TEXT,
    artists TEXT,
    artist_ids TEXT,
    track_number INT,
    disc_number INT,
    `explicit` BOOLEAN,
    danceability FLOAT,
    energy FLOAT,
    `key` INT,
    loudness FLOAT,
    mode INT,
    speechiness FLOAT,
    acousticness FLOAT,
    instrumentalness FLOAT,
    liveness FLOAT,
    valence FLOAT,
    tempo FLOAT,
    duration_ms INT,
    time_signature FLOAT,
    `year` INT,
    release_date TEXT
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

